import React from 'react';
import './styles.scss';

function Agenda() {
  return (
    <div className="agenda-wrapper">
      <div className="agenda-night agenda-item">
        <h1>Games & Beer</h1>
        <h2>After we're back from celebrating spring, we had back to my place and jump right into having more beers, singing along 8-Bit-songs and playing awesome games on the b</h2>
      </div>
    </div>
  );
}

export default Agenda;
